import React from 'react';
import{getAllStock, codes} from '../data/stock';
import { Link } from "react-router-dom";
export const StockList=()=>{
    return(<div>
        {getAllStock().map(s=><Link to={`/StockList/${codes[s]}`}>{s.name}</Link>)}
    </div>)
}
